/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `public_interest_corporations` (
  `public_interest_corporation_id` int NOT NULL AUTO_INCREMENT,
  `public_interest_corporation_name` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '공익법인명',
  `representative_name` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '대표자',
  `establishment_date` date NOT NULL COMMENT '설립연월일',
  `road_name_address` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '소재지',
  `telephone_number` varchar(16) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '전화번호',
  `homepage_address` varchar(256) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '홈페이지주소',
  `email_address` varchar(320) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '전자우편주소',
  `competent_authority` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '주무관청',
  `contribution_type` varchar(8) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '기부금유형',
  `establishment_law` varchar(256) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '설립근거법',
  `establishment_type` varchar(8) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '설립유형',
  `public_business_type` varchar(8) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '공익사업유형',
  `founding_entity` varchar(8) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '설립주체',
  `director_count` int NOT NULL COMMENT '이사수',
  `yearly_volunteer_count` int NOT NULL COMMENT '자원봉사자연인원수',
  `employee_count` int NOT NULL COMMENT '고용직원수',
  `business_status` varchar(512) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '정관에기재된공익목적사업현황',
  `business_activities` varchar(256) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '사업내용',
  `business_targets` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '사업대상',
  `business_domestic_area` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '국내주요사업지역',
  `business_overseas_area` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '국외주요사업지역',
  `business_count` int DEFAULT NULL COMMENT '총공익목적사업수',
  PRIMARY KEY (`public_interest_corporation_id`),
  UNIQUE KEY `public_interest_corporation_name` (`public_interest_corporation_name`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='공익법인';
