INSERT INTO `public_interest_corporations` VALUES (1,'사회복지법인 사회복지공동모금회','김병준','1998-11-13','서울특별시 중구 세종대로21길 39','02-62623023','http://www.chest.or.kr','mijin5@chest.or.kr','보건복지부','법정기부금단체','기타법률 사회복지공동모금회법','기타단체','사회복지','기타',18,2152,400,'1. 사회복지공동모금사업\n2. 공동모금재원의 배분(이하 “배분”이라 한다) 및 평가<개정 2008.6.9.>\n3. 공동모금재원의 운용 및 관리\n4. 사회복지공동모금에 관한 조사ㆍ연구ㆍ홍보 및 교육훈련\n5. 사회복지공동모금회지회(이하 “지회”라 한다)의 운영\n6. 사회복지공동모금에 관한 국제교류 및 협력증진사업\n7. 다른 기부금품모집자와의 협력사업\n8. 기타 모금회의 목적달성에 필요한 사업','배분(지원) 재단','아동 청소년 장애인 외국인(다문화) 가족,여성 기타 사업대상','전국','아시아',10),(2,'국립중앙의료원(National Medical Center)','주영수','2010-04-02','서울특별시 중구 을지로 245 1층','02-22607021','www.nmc.or.kr','heejae.lim@nmc.or.kr','보건복지부','법정기부금단체','기타법률 국립중앙의료원의 설립 및 운영에 관한 법률','공공기관','의료','기타',12,0,1442,'1. 공공보건의료에 관한 임상진료지침의 개발 및 보급\n  2. 노인성질환의 예방 및 관리\n  3. 희귀난치질환 등 국가가 특별히 관리할 필요가 있다고 인정되는 질병에 대한 관리\n  4. 감염병 및 비감염병 또는 재난으로 인한 환자의 진료 등의 예방과 관리\n  5. 남북의 보건의료 협력과 국제 보건의료 관련 국내외 협력\n  6. 민간 및 공공보건의료기관에 대한 기술 지원\n  7. 진료 및 의학계, 한방진료 및 한의학계 관련 연구\n  8. 전공의의 수련 및 의료 인력의 훈련\n  9. ｢응급의료에 관한 법률｣제25조에 따른 응급의료에 관한 각종 사업의 지원\n  10.「모자보건법」 제10조의6에 따른 고위험 임산부 및 미숙아등의 의료지원에 필요한 각종 사업의 지원\n  11.「공공보건의료에 관한 법률」 제21조에 따른 공공보건의료에 관한 각종 업무의 지원\n  12. 법률 제5조제13호 규정에 따라 공공보건의료에 관하여 보건복지부장관이 위탁하는 사업\n  13. 제1호 내지 제13호의 사업에','병원 및 재활시설','모두해당','전국','전세계',1),(3,'대·중소기업·농어업협력재단','김영환','2004-12-27','서울특별시 중구 퇴계로 173 남산스퀘어 7층','02-368-8774','www.win-win.or.kr','cje@win-win.or.kr','중소벤처기업부','지정기부금단체','기타법률 대·중소기업 상생협력 촉진에 관한 법률\n제20조(대ㆍ중소기업ㆍ농어업협력재단의 설립) ① 정부는 대ㆍ중소기업 상생협력을 촉진하기 위하여 대ㆍ중소기업ㆍ농어업협력재단(이하 \"재단\"이라 한다)을 설립한다.','재단법인','기타','국가',10,0,176,'1. 대ㆍ중소기업간 협력사업의 개발ㆍ운영 지원\n2. 기술협력촉진사업의 관리운영 및 평가 지원\n3. 협력관련 정보자료의 수집 및 보급\n4. 수탁기업협의회의 구성 및 운영지원\n5. 수ㆍ위탁거래 공정화를 위한 지원사업\n6. 수ㆍ위탁기업간 분쟁의 자율적 조정\n7. 기술자료 임치제도 운영 및 중소기업기술 보호 지원 사업\n8. 중소·벤처기업 상생 창업육성 및 해외동반진출지원에 관한 사업\n9. 기업간 협력 증진을 위한 학술연구\n10. 대ㆍ중소기업 퇴직인력에 대한 직업 알선\n11. 동반성장위원회 구성·운영\n12. 자유무역협정 체결에 따른 농어업인 등의 지원에 관한 특별법 제18조의2에 의한 농어촌상생협력기금의 관리ㆍ운용\n13. 대·중소기업상생협력기금의 관리·운용\n14. 상생결제의 관리·운영 및 보급·확산 지원\n15. 정부 등의 위탁 또는 용역사업 수행\n16. 설립목적의 달성에 필요한 수익사업으로서 중소벤처기업부장관의 승인을 얻은 사업\n17. 그 밖에 제1호 내지 제16호의 사업과 관련된 부대사업','기타 사업내용','기타 사업대상','해당없음(국내지역)','해당없음(국외지역)',53),(4,'서민금융진흥원','이재연','2016-09-23','서울특별시 중구 세종대로 14 그랜드센트럴(GRAND CENTRAL)','02-21288036','http://www.kinfa.or.kr','jhpark@kinfa.or.kr','금융위원회','지정기부금단체','기타법률 서민의 금융생활 지원에 관한 법률','공공기관','기타','기타',6,0,322,'1. 저소득층의 창업 또는 취업을 지원하기 위한 신용대출사업\n2. 저소득, 저신용 계층을 대상으로 자활에 필요한 창업, 운영 자금 등을 지원하는 소액대출사업\n3. 전통시장 영세상인들에 대한 소액대출 지원\n4. 저소득층의 보험계약 체결 및 유지를 지원하기 위한 사업\n5. 민간사업수행기관에 대한 소액금융사업\n6. 저소득, 저신용 근로자들 생계비 등 대출시 보증해주는 개인신용보증사업 등\n7. 저소득층의 원활한 금융생활 지원을 위한 종합상담 및 금융상품 등의 소개사업','기타 사업내용','기타 사업대상','전국','해당없음(국외지역)',3),(5,'재단법인 기지','박승호','2019-09-01','서울특별시 서대문구 연희로24길 9-2 비101호','02-20708213',NULL,'ideeper@gmail.com','서울시청','지정기부금단체','민법 민법 제32조 및  문화체육관광부 및 문화재청 소관 비영리법인의 설립및감독에 관한  규칙','재단법인','문화','기업',6,0,1,'문화예술사업','문화예술','모두해당','전국','전세계',1),(6,'사회복지법인월드비전','조명환','1950-09-22','서울특별시 영등포구 여의나루로 77-1','02-20787122','www.worldvision.or.kr','dalnim_lee@worldvision.or.kr','보건복지부(영등포구청)','지정기부금단체',NULL,'기타단체','사회복지','기타',18,45406,731,'① 사회복지사업 및 지원사업\n1. 아동복지사업\n2. 청소년복지사업\n3. 노인복지사업\n4. 장애인복지사업\n5. 가정복지사업\n6. 지역사회복지\n7. 기타 제사회복지사업 및 지원사업\n② 사회복지관 운영 및 사회복지시설 설치사업\n③ 교육, 선교, 문화사업\n④ 목적사업 수행을 위한 홍보, 결연사업\n⑤ 국외 원조사업\n⑥ 전 각 항의 사업운영을 위한 수익사업\n⑦ 기타 목적사업 운영에 필요되는 사업','문화예술 초등 및 중등 교육 고등교육 기타교육 학술연구 장학 정신 건강 및 위기개입 기타 보건서비스 사회복지 시민 및 옹호단체 배분(지원) 재단 봉사증진 모금활동 국제활동','모두해당','전국','전세계',8),(7,'사회복지법인 어린이재단','최운열','1948-10-15','서울특별시 중구 무교로 20 어린이재단 11층','02-775-9122','http://www.childfund.or.kr','hypark@childfund.or.kr','보건복지부(중구청)','지정기부금단체','사회복지사업법 제2조의 목적(범위)에 준하며, 제16조에 의하여 설립 허가를 받음','기타단체','사회복지','기타',12,17686,1031,'*주요업무: 아동의 올바른 성장과 발달, 권리 증진을 위한 국내‧외 아동 지원 및 아동옹호사업 수행\n*실    적: 전국 20개 지역본부, 7개 아동옹호센터, 7개 사회복지관, 6개 가정위탁지원센터, 5개 아동보호전문기관, 1개 시흥다어울림아동센터, 1개 중증장애인거주시설, 1개 장애영유아거주시설, 1개 특수학교를 통하여 국내아동 및 참여자 1,086,564명에게 193,155,428,605원을 지원하였고, 전 세계　29개국에서 해외아동 및 참여자 830,439명에게 17,726,803,248원을 지원함.','사회복지 국제활동','모두해당','전국','유럽 아시아 남아메리카 아프리카',2),(