'기타법률 민법 제32조 및행정자치부 및 그 소속청 소관 비영리법인의 설립 및감독에 관한 규칙 제4조에 따라 설립','사단법인','기타','개인',5,175118,35,'1.자원봉사활동기본법 제7조에 의한 복지사업\n2.불우이웃을 위한 무료급식 운영 지원 사업\n3.국내외 취약계층(노인,아동,장애인 등) 생계지원 및 자원봉사 사업\n4.복지,문화,교육 관련 비영리 운영 사업\n5.범죄 예방을 위한 관련기관 지원 사업\n6.국민안전을 위한 환경보호 자원봉사 순찰대 운영사업\n7.정부기관 및 불우시설, 사회단체 지원 사업\n8.소외계층을 위한 시설, 기관 및 사회단체 지원 사업\n9.재해재난 구호활동 및 관련 지원 사업\n10.법인의 목적사업을 위한 기부금품 모집 및 나눔사업\n11.법인의 목적사업을 위한 대면, 비대면 회원모집 사업\n12.기타 법인의 목적달성에 필요한 수입 및 제반 사업등','장학 기타 보건서비스 사회복지 긴급상황 및 구호','모두해당','전국','해당없음(국외지역)',3),(73,'재단법인 바보의나눔','손희송','2010-02-08','서울특별시 중구 명동길 74 천주교서울대교구청 5층','02-727-2502','www.babo.or.kr','babonanum@babo.or.kr','행정안전부','법정기부금단체','민법 제32조 및 「행정안전부 및 그 소속청 소관 비영리법인의 설립 및 감독에 관한 규칙」 제4조','재단법인','기타','기타',12,0,11,'1. 사랑의 나눔문화 확산을 위한 대국민 캠페인 사업 전개.\n 2. 올바른 나눔문화 발전을 위한 정책연구 및 제도개선 사업 전개.\n 3. 개인 및 단체의 지정기탁에 따른 공익기금 및 특정주제를 갖는 목적형 기금 조성.\n 4. 기업과 사회의 상생적 발전을 위한 기업 사회공헌 프로그램 전개.\n 5. 지속적인 공동체 발전과 소외계층의 삶의 질 향상을 위한 국내․외 공익사업 재정적 지원. \n 6. 사회적 약자 지원 및 공익단체 활동지원을 위한 부동산 무상 대여. \n 7. 기타 법인의 목적사업 달성에 필요한 사업.','사회복지 배분(지원) 재단 모금활동','모두해당','전국','유럽 아시아 남아메리카 아프리카',5),(74,'요셉나눔재단법인','유경촌','2022-07-04','서울특별시 영등포구 경인로100길 6','02-26341760','www.josephclinic.org','sslee@josephclinic.org','서울특별시 복지정책과','지정기부금단체','민법 민법, 공익법인의 설립․운영에 관한 법률','재단법인','의료','기타',14,3462,32,'1. 의료사각지대의 가난한 환자를 위한 자선의료서비스사업 및 관련 의료기관 \n 설치·운영\n 2. 저소득층 및 취약계층 환자 후원 및 재활,자립지원사업\n 3. 소외계층의 자립 지원을 위한 수용시설 설치·운영 \n 4. 알코올의존, 사회부적응 등 자활대상자들을 위한 사회심리적 상담 및 재활, \n 자활프로그램 개발·운영과 통합적인 사례관리\n 5. 법인의 사업목적과 맞는 타 사회복지조직과의 프로그램개발 및 인적·물적 \n 지원 등의 연대사업 \n 6. 지역사회복지조직과 연계사업 및 자원봉사자 활동 진흥을 위한 사업\n 7. 그리스도 복음전파를 겸한 국내,국외 빈민 지역 자선 의료·급식·장학 사업\n 8. 「긴급복지지원법」에 의한 위기상황에 있는 소외계층에 대한 긴급지원\n 9. 선우경식 요셉의원 설립자 설립정신과 업적을 기리기 위한 관련 기념사업\n 10. 후원금 모금사업\n 11. 그 밖의 법인의 설립목적에 부합되는 필요한 사업','병원 및 재활시설 사회복지 모금활동 기타 사업내용','노인 장애인 외국인(다문화) 가족,여성 일반대중 기타 사업대상','전국','전세계',4),(75,'재단법인 인천대학교발전기금','박종태','1998-01-22','인천광역시 연수구 아카데미로 119 본관(1호관) 4층 412호','032-835-8080','http://fund.inu.ac.kr','jinkk089@inu.ac.kr','인천광역시동부교육지원청','법정기부금단체',NULL,'재단법인','학술. 장학','기타',15,0,1,'1.장학금의 지급\n2. 학생복지 증진을 위한 사업\n3. 교직원의 교육, 연수 및 연구활동 지원\n4. 도서교육, 연구기자재 및 시설확충 등','기타교육 장학','기타 사업대상','인천','해당없음(국외지역)',1),(76,'재단법인 해피빈','유봉석','2009-05-12','경기도 성남시 분당구 황새울로 246 도담빌딩 에이동 5층','031-600-5378','http://happybean.naver.com','eunyoung.ju@navercorp.com','행정안전부','지정기부금단체',NULL,'재단법인','기타','기업',5,0,23,'1. 기부문화 확산을 위한 온라인 인프라 구축사업\n2. 일반인들의 자원봉사, 기업참여 등 전국민적 나눔 주체들의 커뮤니티를 위한 인프라 구축 사업 \n3. 기부문화 확산을 위한 개인 및 단체, 기업의 기금을 관리하고 배분하는 사업 \n4. 나눔에 대한 올바른 인식을 위한 대국민 캠페인 사업 \n5. 대한민국 NGO, NPO들을 위한 온라인, 오프라인 교육 사업\n6. 기부문화 발전을 위한 정책적 연구 및 제도개선 사업 \n7. 문화창작자, 공익활동 아이디어 제안자, 사회활동가, 창업아이디어 제안자, 공익재단, \n사회적기업, 협동조합, 청년창업자, 소셜벤처, 소상공인 등의 지원 사업\n8. 기타 재단의 목적사업 달성에 필요한 사업','기타 사업내용','모두해당','전국','해당없음(국외지역)',4),(77,'사단법인 전국자원봉사연맹','안미란','2013-04-03','대구광역시 서구 국채보상로 365','053-745-7406',NULL,'1004ngo@naver.com','행정자치부','지정기부금단체','기타법률 민법 제32조 및행정자치부 및 그 소속청 소관 비영리법인의 설립 및감독에 관한 규칙 제4조에 따라 설립','사단법인','기타','개인',5,204436,102,'소외된 계층을 위한 자원봉사 활성화사업\n독거노인 및 빈곤층을 위한 무료급식사업\n시민사회와 국가공익에 필요한 시민연대활동\n복지,경제, 정치,환경, 문화등 사회전반 각 분야에 필요한 시민교육사업\n해외동포 및 국제빈민을 위한 물자지원사업\n기타법인의 목적달성에 필요한 자원봉사활동 및 수익사업','사회복지','모두해당','전국','아시아',1),(78,'재단법인플랜한국위원회','이상주','1996-05-20','경기도 성남시 분당구 판교역로 231 H스퀘어 S동 912, 913호','02-15443222','www.plankorea.or.kr','kno@plankorea.or.kr','외교통상부','지정기부금단체','민법 민법 제32조(사회복지법인)','재단법인','사회복지','기타',6,150,32,'1. 개발도상국 및 저개발국의 아동과 그의 가족에 대한 원조 및 문화교류를 통한 지역개발사업 시행\n2. 국내 긴급지원이 필요한 어린이 및 청소년 지원','초등 및 중등 교육 고등교육 장학 영유아보육 정신 건강 및 위기개입 기타 보건서비스 사회복지 긴급상황 및 구호 소득 지원 및 보존 환경 경제, 사회 및 지역사회개발 주거 고용 및 훈련 기타 사업내용','아동 청소년 외국인(다문화) 기타 사업대상','전국','아시아 남아메리카 아프리카',4),(79,'재단법인 그린피스','Sze Pang Cheung','2013-10-28','서울특별시 용산구 한강대로 257 6층','02-31441994','www.greenpeace.org/korea','jiykim@greenpeace.org','서울특별시','지정기부금단체','민법 민법제32조 및 환경부 및 기상청 소관 비영리법인의 설립 및 감독에 관한 규칙 제3조의 규정','재단법인','기타','기타',4,6375,69,'본 법인은 자연환경의 보호, 생태계의 보존 및 자연환경에 대한 인간의 인식 고양을 주요 목적으로 하는 글로벌 캠페인 활동 단체이다.  \n1. 자연 환경 변화에 대한 의식 고양을 위한 홍보, 교육 및 캠페인 활동 \n2. 자연 환경 변화에 대한 연구 및 조사 활동 및 지원\n3. 자연 환경 