인','기타','기타',7,0,44,'본 재단은 환경에 관한 연구와 교육, 환경의 보호와 향상을 위해 노력하는 개인 및 단체의 활동을 지원함으로서 지속 가능한 사회를 지향하고 국제환경교류를 촉진하는데 기여하는 것을 목적으로 한다. \n1. 환경단체와 환경관련 연구기관 지원\n2. 환경 연구 프로젝트 지원\n3. 시민환경경의식의 고양을 위한 환경행사 지원 및 교육, 문화사업\n4. 제3세계 환경운동 지원을 위한 국제 학술교류 및 지원\n5. 친환경 전문 인력 양성을 위한 장학사업\n6. 환경단체 공동시설 건립지원\n7. 환경관련 컨설팅 및 조정\n8. 모범 환경인 및 환경 단체에 대한 시상\n9. 환경운동가의 재교육 및 전문성 배양을 위한 장학사업\n10. 사업시설 관리 및 사업지원 서비스업\n11. 환경 분야 기업 육성을 위한 창업자 선발, 보육 및 투자\n12. 동물 복지, 멸종 위기종 동식물 보호 등 생태계 보호를 위한 사업\n13. 기타 재단의 목적 달성에 필요한 사업','문화예술 초등 및 중등 교육 고등교육 기타교육 장학 사회복지 긴급상황 및 구호 환경 동물 시민 및 옹호단체 배분(지원) 재단 모금활동 국제활동','모두해당','전국','아시아',7),(118,'(재)더작은재단','오승환','2014-02-17','서울특별시 종로구 북촌로 71 1층','02-743-1801',NULL,'sol@thesmallfoundation.org','문화체육관광부 예술정책과','지정기부금단체','기타법률 민법 제23조와 문화체육관광부 및 문화재청소관 비영리법인의 설립 및 감독에 관한 규칙','재단법인','문화','기타',5,0,22,'이 법인은 시각장애인 전시장을 마련하여 문화예술을 통하여 이 시대의 대한민국의 장애인, 소외계층, 청소년 등이 바른 꿈을 꾸며 건강하게 자랄 수 있는 세상을 만드는 기반조성과 기회제공 및 그 지원을 목적으로 한다. \n1. 문화적 공간환경조성(시각장애인전용전시장 등)통한 전시 및 공연지원\n2. 문화예술 소외계층 체험기회 확산\n3. 장애인 문화예술 관련 자료 개발 및 활동지원\n4. 문화예술을 통한 청소년 자기개발 기회 확대\n5. 기타 재단의 목적에 부합하는 사업','문화예술 기타 레크리에이션 및 봉사 클럽 기타 사업내용','청소년 장애인','전국','해당없음(국외지역)',3),(119,'재단법인사람사는세상노무현재단','정세균','2009-10-30','서울특별시 종로구 창덕궁길 73','070-79310526','www.knowhow.or.kr','knwowhow@knowhow.or.kr','행정안전부','지정기부금단체','민법 제32조 및 행정안전부 및 그 소속청 소관 비영리법인의 설립 및 감독에 관한 규칙 제 4조','재단법인','기타','개인',8,150,57,'노무현 전 대통령의 가치와 철학, 업적을 유지 게승 발전하기 위한 추모, 기념사업\n노무현 전 대통령의 가치와 철학, 업적에 대한 연구학술 활동 및 지원\n목적사업과 관련하여 연수, 국제협력, 홍보 및 출판 등','문화예술 기타교육 학술연구','모두해당','전국','해당없음(국외지역)',11),(120,'사회복지법인 승가원','천원배','1996-02-06','서울특별시 성북구 개운사길 76-1','02-16880750','http://www.sgwon.or.kr','happysgwon@daum.net','성북구청','지정기부금단체',NULL,'재단법인','사회복지','기타',14,3000,375,'- 장애인복지시설 설치, 운영\n- 종합사회복지관 수탁운영\n- 아동과 청소년의 건전육성을 위한 아동청소년시설의 설치, 운영\n- 노인종합복지관 및 요양시설 설치, 운영\n- 기타 법인목적사업달성에 필요한 사업','사회복지','장애인','전국','해당없음(국외지역)',10),(121,'재단법인 라이나전성기재단','최종구','2013-05-20','서울특별시 종로구 삼봉로 48','02-63306852','https://www.junsungki.com/foundation/index.do','jhhwang@linafoundation