을 위한 대국민 홍보ㆍ조사ㆍ정책 연구\n2. 개인, 단체, 기업의 지정기탁에 따른 공익기금 및 특정주제를 갖는 목적형 기금조성\n3. 사회복지모금사업, 모금재원의 운용․관리 및 배분사업\n4. 재난재해구호, 해외난민구호 등 인도적 지원사업\n5. 민족 화합과 협력을 위한 공동체 회복 지원사업\n6. 소외계층의 삶의 질 향상을 위한 공익사업 지원\n7. 공공의 삶과 직결된 환경보호에 대한 시민의식 고취사업\n8. 기타 법인의 목적사업 달성에 필요한 사업','사회복지 긴급상황 및 구호 배분(지원) 재단 모금활동 기타 사업내용','모두해당','전국','아시아 아프리카',3),(170,'(재)케이티그룹희망나눔재단','조성준','2009-11-15','서울특별시 종로구 창경궁로 136 보령빌딩 14층','02-34142045','http://www.ktgf.or.kr','jhlee@ktgf.or.kr','과학기술정보통신부','지정기부금단체','민법 민법 제32조','재단법인','기타','기업',4,0,241,'1. 정보통신(ICT)의 올바른 활용, 증진, 발전을 위한 학술․교육 및 국제교류 협력사업\n2. 정보문화에 대한 이해 증진 및 확산․발전에 관한 사업\n3. 방송․미디어 콘텐츠 창작 및 보급, 확산사업\n4. 창의적 인재 육성을 위한 장학사업\n5. 사회적 약자의 정보통신(ICT) 활용증진 및 사회복지 관련 사업\n6. 과학기술정보통신부에서 시행하는 정보통신(ICT) 및 문화관련 사업\n7. 주식회사 케이티 및 그 계열사 등의 출판, 광고, 행사대행 및 교육훈련․후생시설 운영\n8. 인도적 지원을 위한 대북협력사업 (2019. 2.26.변경)\n9. 기타 재단 목적달성에 필요한 부대사업','초등 및 중등 교육 기타교육 학술연구 장학 기타 보건서비스 사회복지 긴급상황 및 구호','모두해당','전국','해당없음(국외지역)',23),(171,'사단법인 국제앰네스티한국지부','신민정','2005-04-26','서울특별시 종로구 율곡로 56 운현하늘빌딩 8층','02-730-4755','http://www.amnesty.or.kr/','dsyoo@amnesty.or.kr','국가인권위원회','지정기부금단체','민법 \'민법\' 제32조 및 \'국가인권위원회 소관 비영리법인의 설립 및 감독에 관한 규칙\' 제4조','사단법인','기타','기타',10,0,25,'지부는 국제앰네스티 규약의 이념과 가치에 따라 세계인권선언을 비롯한 국제인권기준들이 모든 사람에게 보편적으로 보장되는 세계를 이루기 위해 활동하는 것을 목적으로 한다.\n1. 정부, 정부간 기구, 무장 정치 그룹, 기업 그리고 기타 비국가 행위자들의 반인권적인 모든 활동에 항의 제기\n2. 인권침해에 대한 정확하고 신속하며 지속 적인 폭로와, 이를 위해 개별 사례의 사실과 인권침해의 유형에 대한 체계적이고 공정한 조사\n3. 구체적인 인권침해에 관한 활동에 부가하여, 모든 정부들에게 법의 지배를 준수하고, 인권기준들을 비준하고 이행할 것을 요청\n4. 광범위한 인권교육 활동의 수행과 인권을 지지하고 존중하도록 정부간 기구, 개인들, 그리고 모든 사회조직을 독려하는 일련의 사업 전개\n5. 기타 제2조의 목적을 달성하기 위해 필요한 활동과 사업의 전개','기타교육 시민 및 옹호단체 국제활동 기타 사업내용','모두해당','전국','전세계',4),(172,'사단법인 글로벌생명나눔','신언항','2020-06-18','서울특별시 금천구 가산디지털2로 14 대륭테크노타운12차 320호','02-862-2690','www.gls2020.or.kr','gls2020@naver.com','서울특별시','지정기부금단체','민법 민법 제3장(법인)및 행정권한의 위임 및 위탁에관한규정 제22조 의2','사단법인','사회복지','기타',4,120,1,'1.해외 의료 빈곤지역 의료용품 및 의료기기 지원사업\n2. 해외 재난현장 긴급 재난구호활동 및 자원봉사활동\n3. 국내외 외국인 무료진료 및 취약아동지원 활동\n4. 국제구호개발을 위한 관련연구 및 세미나\n5. 그밖의 목적달성에 필요한 사업