단체','기타법률 민법32조','재단법인','학술. 장학','개인',6,0,6,'① 이 법인은 제2조의 목적을 달성하기 위하여 다음의 목적사업을 행한다.\n  1. 기초과학의 대중화를 위한 콘텐츠의 개발 및 그 연구 지원\n  2. 기초과학과 타 학술 간 융합을 위한 방안 연구 및 지원  \n  3. 토론, 콘서트 등 일반인을 위한 기초과학 대중화 프로그램 기획 및 진행\n  4. 기초과학 대중화 및 저변 확대를 위한 웹사이트 운영\n  5. 기초과학의 저변 확대를 위한 타 학술 및 연구기관과의 교류\n  6. 기타 각 호 사업의 수행과 본재단목적달성에 필요한 사업\n ② 제1항의 목적사업의 수행과 본재단목적달성에 필요한 수익사업을 전개할 수 있다.\n  1. 기초과학 학술서 출판사업\n  2. 도서‧서적‧문구‧전자서적‧음반‧영상물의 제조․출판‧공급‧도소매업‧판매업\n  3. 전시 및 행사 대행, 장소 대여업\n  4. 미디어콘텐츠업(창작업)\n  5. 기타 각 호 사업의 수행과 본재단목적달성에 필요한 사업','기타 사업내용','모두해당','전국','전세계',7),(536,'(재)부산경제진흥원','진양현','2000-07-01','부산광역시 연제구 중앙대로 1090','051-600-1752','www.bepa.kr','ksm@bepa.kr','부산지방중소벤처기업청','지정기부금단체','기타법률 지역균형개발 및 지방중소기업 육성에 관한 법률','재단법인','기타','지방자치단체',9,0,139,'(1)원-스톱 기업지원업무를 통한 중소기업 애로상담 및 해결 지원\n(2)각종 산업,금융,경영,산업기술 등의 제공\n(3)고용정보의 수집제공, 구인구직의 개척, 직업지도, 상담, 알선, 국내외 직업소개, 직업교육훈련 등\n(4)경영컨설팅, 정보화 지원 등 기술개발종합지원과 종합기술지도\n(5)경영, 기술 등 교육연수사업\n(6)공동전시판매장의 설치, 운영 등 부산상품 국내 판매 활동 지원\n(7)해외무역 정보 제공 및 수출전략 지원, 해외무역사무소 및 해외지사 설치운영\n(8)중소기업 운전자금 추천, 중소기업 육성자금 지원관리 등 자금 지원\n(9)소상공인 지원, 재래시장 활성화 사업 등 지식서비스산업 육성 지원\n(10) 의료기기, 의료융복합기술 등 보건의료산업 육성 및 지원\n(11) 창업정보제공과 창업보육사업\n(12) 일반,도시첨단 산업단지 및 농공단지 관리 운영\n(13) 부산신발산업진흥을 위한 육성사업 지원','경제, 사회 및 지역사회개발 고용 및 훈련','모두해당','부산','해당없음(국외지역)',172),(537,'한국국제보건의료재단','김창엽','2006-08-18','서울특별시 광진구 능동로 400 보건복지행정타운 7동','02-33969880','www.kofih.org','sjcho@kofih.org','보건복지부','지정기부금단체','기타법률 한국국제보건의료재단법','공공기관','기타','국가',11,0,94,'재단은 개발도상국가를 비롯한 외국, 군사분계선 이북지역(이하 \'북한\'이라고 한다.), 재외동포 및 외국인근로자 등에 대한 보건의료지원사업을 수행함으로써 국제협력 증진과 인도주의의 실현에 기여함을 목적으로 한다.','기타 보건서비스 국제활동','아동 외국인(다문화) 가족,여성','전국','아시아 아프리카',1),(538,'사단법인 아드라코리아','강순기','1995-04-12','서울특별시 동대문구 망우로 82','02-32995257','www.adra.or.kr','adrakr0@kuc.or.kr','보건복지부','지정기부금단체','민법 민법 제32조','사단법인','사회복지','개인',15,312,6,'1.  국내외에서  재난을  당한  난민들에  대한  구호사업\n2.  긴급구호사태와  재난  대비를  위한  계몽\n3.  각종  사회복지  문제와  관련된  프로그램  개발,  교육  및  각종  서비스  제공\n4. 상기 목적사업 수행에 필요한 재원조달을 목적으로 수익사업에 종사하는 일\n5.  기타  위의  사업과  관련된  제반  활동','초등 및 중등 교육 기타교육 사회복지 긴