nds.org','ngosfi@ngosfi.org','외교부','지정기부금단체','민법 민법 제32조 및 외교부 소관 비영리법인의 설립 및 감독에 관한 규칙 제4조에 따라 법인의 설립을 허가 받음','사단법인','기타','개인',6,85,0,'본 법인은 제3조의 목적을 달성하기 위하여 다음의 사업을 할 수 있다.\n가. 긴급구호 및 국내외 원조사업: 기근, 지진 등 기타 천재지변을 당한 지역과\n재난 지역에 구호금품 지원 및 구호 인력 파견\n나. 개발사업: 구호 대상 지역의 개발과 자립을 위한 기금, 시설 및 인력지원\n다. 의료사업: 의료봉사 대상지역에 의약품, 시설 및 인력지원\n라. 구호사업 지원을 위한 모금사업\n마. 문화사업: 우리나라 문화 및 스포츠 등을 제3세계 개최 및 교류\n바. 홍보/출판사업: 목적사업 수행을 위한 홍보, 출판사업\n사. 교육사업: 구호, 개발, 문화 등의 교육과 자원봉사자, 후원자, 회원 교육과\n국내 및 해외 NGO활동가의 양성 및 파견\n아. 무상 대출사업: 사회적기업, 협동조합, 마을기업 등의 사회적경제 활동에 대한 무상 대출사업\n국내외 저소득층의 빈곤탈출을 위한 소액(창업)자금 무상 대출사업\n자. 전 각 항의 사업운영을 위한 수익사업\n차. 기타 목적사업 운영에 필요 되는 제반 활동','장학 긴급상황 및 구호 경제, 사회 및 지역사회개발 국제활동','모두해당','서울','아시아 남아메리카 아프리카',24),(821,'청년 교육 사회적협동조합 씨드콥','이승환','2015-03-26','서울특별시 강남구 개포로 508 오피스허브 216호','010-85282966',NULL,'hwan8495@seedcoop.org','교육부','지정기부금단체',NULL,'법인으로보는단체','교육','기업+개인',3,3,7,'다양한 양질의 교육 콘텐츠들을 바탕으로 혁신적인 진로체험교실을 학교 현장에서 실시함으로써 취약계층 학생들이 필요로 하는 진로체험형 교육서비스를 제공하고 비영리법인인 사회적협동조합의 공익적 활동을 통해 다양한 청년 교육 사회적기업들의 안정적이고 지속적인 사업수행에 기여함을 목적으로 한다.','초등 및 중등 교육 고등교육 기타교육 학술연구 장학 시민 및 옹호단체 봉사증진 모금활동 국제활동','아동 청소년 노인 외국인(다문화)','전국','전세계',2),(822,'(복)유린보은동산','정인호','1973-04-30','서울특별시 중랑구 신내로 56','02-433-5672','www.wonyurin.or.kr','wonyurin@hanmail.net','중랑구청','지정기부금단체',NULL,'기타단체','사회복지','기타',8,100,3,'장애인복지, 노인복지, 종합사회복지관, 어린이집, 자활센터 설치 및 운영','사회복지','아동 노인 장애인 기타 사업대상','서울 경기','해당없음(국외지역)',5),(823,'(사)한국예술문화단체총연합회','이범헌','1961-12-05','서울특별시 양천구 목동서로 225','010-36593309','http://www.yechong.or.kr/','yechongbon@naver.com','문화체육관광부','지정기부금단체','민법 민법 제32조\n문화체육관광부 및 문화재청 소관 비영리법인의 설립 및 감독에 관한 규칙 제4조','사단법인','문화','개인',36,0,19,'①정관에 기재된 공익목적사업 현황\n 1. 예술 각 분야의 관계 단체 및 기관과의 상호협력을 위한 각종 행사 개최 \n  2. 예술문화인의 사회적 지위향상을 위한 사업\n 3. 한국예술의 지향성을 검토 모색을 위한 심포지움 개최\n 4. 국내외 예술 문화활동에 관한 자료수집과 조사 통계\n 5. 10개 예술분야의 사업보고 및 국내외 예술 활동 보고대회 개최\n 6. 한국예술문화의 해외진출 및 교류 사업추진\n 7. 예술문화 홍보를 위한 종합예술지 발간 보급(국내판, 해외홍보판, 웹진)\n 8. 국내외 예술문화인 초청 순회강연회, 토론회 개최\n 9. 예술진흥을 위한 사회문화교육원 운영\n 10. 예술문화정보 홍보 및 자료 관리를 위한 전산망 구축 및 운영\n 11